export const storage = {

    cookie: (name, value, options) => {

        function encode (val) {
            try {
                return encodeURIComponent(val);
            } catch (e) {
                return null;
            }
        }

        function decode (val) {
            try {
                return decodeURIComponent(val);
            } catch (e) {
                return null;
            }
        }

        function set (key, val) {
            let opts = arguments[2] === undefined ? {} : arguments[2];

            var str = '' + encode(key) + '=' + encode(val);

            if (val == null) options.maxage = -1;

            if (opts.maxage) {
                opts.expires = new Date(+new Date() + opts.maxage);
            }

            if (opts.path) str += '; path=' + opts.path;
            if (opts.domain) str += '; domain=' + opts.domain;
            if (opts.expires) str += '; expires=' + opts.expires.toUTCString();
            if (opts.secure) str += '; secure';

            document.cookie = str;
        }

        function get (key) {
            var cookies = parse(document.cookie);
            return !!key ? cookies[key] : cookies;
        }

        function parse (str) {
            var obj = {},
                pairs = str.split(/ *; */);

            if (!pairs[0]) {
                return obj;
            }
            var _iteratorNormalCompletion = true;
            var _didIteratorError = false;
            var _iteratorError = undefined;
            var _iterator, _step;

            try {
                for (_iterator = pairs[Symbol.iterator](), _step; !(_iteratorNormalCompletion = (_step = _iterator.next()).done); _iteratorNormalCompletion = true) {
                    var pair = _step.value;

                    pair = pair.split('=');
                    obj[decode(pair[0])] = decode(pair[1]);
                }
            } catch (err) {
                _didIteratorError = true;
                _iteratorError = err;
            } finally {
                try {
                    if (!_iteratorNormalCompletion && _iterator.return) {
                        _iterator.return();
                    }
                } finally {
                    if (_didIteratorError) {
                        throw _iteratorError;
                    }
                }
            }

            return obj;
        }

        if (arguments.length < 2) {
            return get(name);
        }

        set(name, value, options);
    }
};

