				delete handler.sId;
			}
			object[addOrRemove](e, handler, useCapture);
			ret = {evt: e, id: listenerId, fn: handler};
			return ret;
		});
	} catch (e) {
		console.error('Error attaching event listener', e, addOrRemove, object, eventNames, handler);
		return false;
	}

}

